import React from "react";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
import Card from "./Card";
import Sdata from "./Sdata";

const App = () => {
  return (
    <>
      {Sdata.map((val, ind) => {
        return (
          <Card
            key={ind}
            title={val.title}
            imgsrc={val.imgsrc}
            note={val.note}
            link={val.link}
          />
        );
      })}
    </>
  );
};

export default App;
